values:
I read this in a book that I have just finished and it applied to me so much.  

The Al Chayt
Because the relief of pain is built into its perception,
I search within and remember when:
I did not use my power; I did not see; I resisted change; I wouldn't risk; I was afraid of excitement;
By these namings, I ask for the help that I long for, the curative help, the insight.

We violate that which is Eternal when we violate ourselves; for our failures of truth, we ask for honesty and courage:
For acting out of fear of looking at ourselves deeply and honestly;
And for using honest self-examination as a substitute for changing ourselves. 
For paralyzing ourselves by thinking we could not chang;
And for using these prayers as a substitute for real change.
For perpetuating vindictiveness by not forgiving our parents for the hurst they have inflicted on us as children;
And for sustaining guilt and anziety by not forgiving ourselves for the negative traits we inherited.
For giving ourselves to the fleeting pleasure of inflicting lasting hurts;
And for cynicisim which eats away our faith in the possibility of love.
In naming these errors, I confront them, I accept them, and I commit myself to avoiding them in the year ahead.

We evade that which is Eternal when we evade ourselves; for our failures of truth, we ask clear vision:
For those times I turned a deaf ear on the cries of children;
And for those times I turned a deaf ear to the small child within me.
For those times when I believed that I was alone, and that there was no point in reaching out to others;
And for those times when I believed that my temporary helplessness was permanent,
In recalling this pain, I experience it, I heal it, and I commit myself to replacing it with joy in the coming year.

We deny that which is Eternal when we deny our own depths.
For the misdeeds we have committed with our bodies and souls, we here today seek to speak them out, expose them to the air, to our tears, to our laughter.
For not being present in the moment, and instead, being off somewhere else, worrying;
For not allowing ourselves to play;
For focusing only on our shortcomings, and not on our strengths and beauties;
For the blessings I lost by not trusting myself;
And for the blessings I lost by not trusthing others;
For withholding love and support;
And for being judgmental of others and myself.
For thinking I would run out of love it I gave too much of it away;
And for doubting my ability to love and recieve love from others.

And again, I remember:
My non-involvement;
Failing to love;
Failing to see the humor.

In naming these lost blessings, I let go of regret and bitterness, I recognize the inexhaustibility of life's blessings, and I vow to be open to these blessings as they come to me in this comming year.
